INSERT INTO `effectifs` VALUES (32,'Zussman','Siegfried','Le pionnier',1,9,'Pionnier',NULL,'Militaire du rang','1920-02-02','Koenigsberg','Allemande',180,NULL,'STG44','Luger P08','Couteau de tranchee, pelle, marteau, mines, pieux','Uniforme du 916. Grenadier Regiment, Pionniers','1940-1942: Engagement volontaire a 20 ans dans la Wehrmacht. Affecte a la 916. Infanterie-Regiment. Formations de base a Berlin. Missions de securisation en Bretagne et surveillance cotiere.\n1942-1943: Affecte temporairement a l\'Est comme soutien logistique lors des operations autour de Minsk. Retour rapide a l\'Ouest: reconnu pour ses competences en construction de fortifications.\n1944: Promotion au rang d\'Unterfeldwebel debut octobre. Creation de la Compagnie Z, une unite pionniere specialisee dans les embuscades, la demolition de ponts, et le combat rapproche (CQB). Interventions a Omaha, Coutance, Falaise, Sainte-Marie.\nDecembre 1944: Demission volontaire du grade d\'Unterfeldwebel pour raisons internes (crise de commandement, usure morale). Dissolution de la Compagnie Z. Retour dans les rangs reguliers en tant que Oberschuetze, puis rapidement Gefreiter au merite. Integre les pionniers de la 191eme puis, transfere en pionniers dans le 916. Regiment.','Croix de fer de 1er classe\nCroix de fer de 2e classe\nInsignes de combat general\nInsigne de combat d\'infanterie en bronze\nAgrafe de combat rapproche en argent\nAgrafe de combat rapproche en bronze','Aucun manquement disciplinaire. Refus volontaire de promotion Uffz depuis decembre 1944.',NULL,NULL,NULL,'1940-07-15','2024-07-15',NULL,'Actif','2026-02-12 23:21:32','2026-02-12 23:21:54');
